import React from 'react';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';


const Note = () => {

	return(
			<>
				<div className="note">
					<h1>Title</h1>
					<p>This is notes</p>
					<DeleteOutlineIcon className="deleteIcon" />
				</div>
			</>
		);
};

export default Note;
